import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import pton_logo from "./pton_logo.png";

const useStyles = makeStyles((theme) => ({
  root: {
    // bottom: "0",
    // width: "100%",
    // height: "100%",
    // backgroundColor: "#000000",
    // borderStyle: "solid",
    // borderColor: "#f58025",
    // borderWidth: "4px 0px 0px 0px",
    // color: "#ffffff",
    // position: "relative",
    // minWidth: "1200px",
    boxSizing: "inherit",
  },
  footer: {
    flex: "initial",
    width: "100%",
    position: "relative",
    borderTop: "4px solid #f58025",
    paddingTop: "16px",
    paddingLeft: "32px",
    paddingRight: "32px",
    paddingBottom: "16px",
    backgroundColor: "#221e20",
  },
  logo: {
    padding: "0",
    marginLeft: "0",
    marginRight: "0",
  },
  contacts: {
    color: "#ffffff",
    textAlign: "center",
  },
}));

export default function Footer() {
  const classes = useStyles();

  return (
    <footer className={classes.root}>
      <div classname={classes.footer}>
        <Container className={classes.logo}>
          <img
            src={pton_logo}
            style={{ width: "20%", paddingLeft: "20px", paddingTop: "10px" }}
          ></img>
        </Container>
        <Container className={classes.contacts}>
          <strong>Contacts</strong>
          <p>Pace Center for Civic Engagement</p>
          <p>201 Frist Campus Center Princeton, NJ 08544</p>
          <p>58 Prospect Avenue, Third Floor</p>
          <p>609.258.7260 | pace@princeton.edu</p>
        </Container>
      </div>
    </footer>
  );
}
